import { Component } from 'react';

export default function Navbar() {
    return (
        <nav className="navbar navbar-expand-lg navbar-light" style={{ backgroundColor: '#DEA80A' }}>
            <div className="container-fluid">
                <span className="navbar-brand mb-0 h1">CLASS HUB</span>
                <div className="d-grid gap-2 d-md-flex justify-content-md-end">
                    <button className="btn me-md-2" type="button" data-bs-toggle="modal" data-bs-target="#loginPopup" style={{ marginLeft: '15px' ,backgroundColor:'#196432'}}>LOGIN</button>
                    <button className="btn me-md-2" type="button" data-bs-toggle="modal" data-bs-target="#registerPopup" style={{ marginLeft: '15px',backgroundColor:'#364e4a' }}>REGISTER</button>
                </div>
            </div>

        </nav>


    )

}
